import { Domicilio, LuogoDiNascita, Persona, Ospite, Residenza, ContoCorrente, DocumentoIdentita } from '@prisma/client';

type OspiteInsert = Omit<Ospite, 'id' | 'possiedeCauzione' | 'codiceDipartimentoUnitn'> & {
  persona: {
    create: Omit<Persona, 'id' | 'dataCreazione' | 'eliminato'> & {
      luogo_di_nascita: {
        create: Omit<LuogoDiNascita, 'id'>;
      };
      residenza: {
        create: Omit<Residenza, 'id'>;
      };
      domicili?: {
        createMany: {
          data: Omit<Domicilio, 'id' | 'idPersona'>[];
        }
      };
    }
  };
  dipartimentoUnitn: {
    connect: {
      codice: string;
    }
  };
  conto_corrente?: {
    create: Omit<ContoCorrente, 'id'>;
  };
  documentoIdentita?: {
    create: Omit<DocumentoIdentita, 'id'>;
  };
};

